const MenuB = () => {
    return(
        <div className = "h-screen w-11/12 bg-gray-500">
            <div className = "grid grid-areas-menuB-layout gap-5 w-3/4 -ml-5">
                <div className = "grid grid-in-vertical1 bg-green-500 h-96">

                </div>
                <div className = "grid grid-in-vertical2 bg-green-700 h-96">

                </div>
                <div className = "grid grid-in-vertical3 bg-green-800">

                </div>
            </div>
        </div>
    )
}

export default MenuB;
